package com.group.sshop.models.dto;import com.group.sshop.validate.FieldsValueMatch;import com.group.sshop.validate.UniqueEmail;import jakarta.validation.constraints.Email;import jakarta.validation.constraints.NotBlank;import jakarta.validation.constraints.NotNull;import jakarta.validation.constraints.Size;import lombok.Getter;import lombok.Setter;import lombok.ToString;@Getter@Setter@ToString@FieldsValueMatch(        field = "confirmPassword",        fieldMatch = "password",        message = "Passwords do not match!")public class RegisterFrom {    @Email(message = "")    @UniqueEmail    private String email;    @NotBlank(message = "")    @Size(min = 6, max = 32, message = "Password has 6 to 32 character !")    private String password;    @NotBlank(message = "")    private String confirmPassword;    @NotBlank(message = "")    private String fullName;    @NotNull    private Boolean agree;}